window.bookSummaryJSON = "<p>I found my brother's murderer, by becoming his next victim.</p> <p>The asshat killed me, too. But little does he know - I came back. Again.</p> <p>Now he's going down. But before I can destroy him, I need to resolve the little issue of me not dying. That's twice now I've cheated death. Something's not right.</p> <p>Graves doesn't think I'm a reaper, and the ghosts seem to agree with him. They say that I'm different. That I'm more.</p> <p>All I know is that things are getting real weird in Farrow's Square and dying is hungry work.</p> <p>Where's a truckload of Hostess cupcakes when a girl needs them? </p> <p><b>Contains mature themes.</b></p>"; 
